import { useEffect } from "react"

const PokeCard = (data) => {
    useEffect(() => {
        axios
            .get(data.url)
            .then(res => console.log(res))
    }, [data]);
    return (
        <div>
            Hello {data.name}!
        </div>
    )
} 

export default PokeCard
